import './Posts.css';
import { useSelector, useDispatch } from 'react-redux';
import {GetPosts} from '../../services/post_services'
function Posts() {
  const dispatch = useDispatch();
    useEffect(() => {
      GetPosts(dispatch);
      }, []);
  const posts = useSelector(state => state.posts);
  
